import './Slider.css'



const SliderComponent =() => {
return(
<div className='slider_image'>
<div className='slider_content'>
    <h6>INTRODUCING</h6>
    <h1>FOREVER</h1>
    <p>Our contribution to the planet</p>
</div>
</div>
)
}


export default SliderComponent;
